
def count_negatives(grid):
    #Initialize variables
    count = 0
    n = len(grid[0])
    current_index = n - 1

    # Iterate on all rows of the matrix one by one.
    for row in grid:
        # Decrease 'current_index' so that it points to current row's last positive element.
        while current_index >= 0 and row[current_index] < 0:
            current_index -= 1
        # Count the number of negative numbers in the current row and
        # Add them in the count variable
        count += (n - (current_index + 1))
    return count
    


def print_matrix(matrix):
    for row in matrix:
        print(row)


